import React from "react";
import "../css/style.css";

const Gallery = () => {
  return (
    <>
      <section>
        <div className="container">
          <div className="gallery">
            <a>
              <img></img>
            </a>
            <div className="desc"></div>
          </div>
        </div>
      </section>
    </>
  );
};

export default Gallery;
